import React from 'react';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import Sidebar from './Components/Sidebar/Sidebar';
import Products from './Pages/Products/Products'; // Import your Products component
import Users from './Pages/Users/Users'; // Import your Users component
import Communities from './Pages/Community/Community'; // Import your Communities component
import Notifications from './Pages/Notifications/Notifications'; // Import your Notifications component
import './App.css';

function App() {
  return (
    <Router>
      <div className="container">
        <Sidebar />
        <Switch>
          <Route path="/products">
            <Products />
          </Route>
          <Route path="/users">
            <Users />
          </Route>
          <Route path="/communities">
            <Communities />
          </Route>
          <Route path="/notifications">
            <Notifications />
          </Route>
        </Switch>
      </div>
    </Router>
  );
}

export default App;
